							<p class="mission__text">
								Наша задача – обеспечить потребителей на рынках, где мы
								работаем, необходимыми им продукцией и услугами, связанных с
								процессом снабжения, маркетингом, логистикой, финансированием и
								технологическим консалтингом с наилучшим сочетанием цена /
								качество.
							</p>
							<p class="mission__text">
								Качественное выполнение ХимПартнерами этой задачи позволит
								производителям промышленных товаров и профессиональным
								дистрибуторам всецело сосредоточиться на достижении своих
								основных целей. Мы предоставим удобный и эффективный сервис,
								направленный на решение конкретных задач, профессионализм наших
								людей сделает общение с нами удобным и эффективным.
							</p>
							<p class="mission__text">
								В лице ProPartners наши потребители и контрагенты всегда будут
								иметь комфортного, предсказуемого и надежного партнера, что
								приведет их к процветанию, лидерству в своих отраслях и общему
								удовлетворению бизнесом и жизнью в целом.
							</p>
